import React from 'react';
import { useForm } from '../Redux/FormContext';

const Debug = () => {
    const {formData, updateFormData} = useForm();

    if (!formData){
        return(
            <div><h1>No Form Data found...</h1></div>
        )
    }

    const { formState } = formData;

    return(
        <div>
            <h1>
                This is a debugging page
            </h1>
            <p>{formState}</p>
        </div>
    )
}

export default Debug;
